<h5>ED-00010: F1 and Skiing</h5>
<p>This dataset contains the results of F1 Racing competitions between 1961 and 2008 as well as Cross Country Skiing and Ski Jumping results from the 2006-2009 World Championships.  This data is provided by <a href="http://robert.bredereck.info/">Robert Bredereck</a> at TU:Berlin.  Robert provides tools to compute Kemeny rankings on this data at his <a href="http://fpt.akt.tu-berlin.de/kconsens/README">website at TU Berlin</a>.</p> <p> The data in this set contains between 10 and 351 candidates (racers, cars) and 4 go 19 voters (competitions).  The results from each competition in the season provides a rank ordering over the candidates (competitors).  We have extended this data into tournament graphs, weighted majority graphs, and created a <b>toc</b> dataset where all candidates are tied, at the end of rankings.</p>

<p><h6>Required Citations</h6><p><ul> 
<li>None.</li></ul></p>

<p><h6>Selected Citations Using This Dataset</h6><p><ul> 
<li> <a href="http://scholar.google.com/scholar?as_q=Fixed-Parameter+Algorithms+for+Computing+Kemeny+scores+-+Theory+and+Practice">Fixed-Parameter Algorithms for Computing Kemeny scores - Theory and Practice.</a> R Bredereck. Thesis, Department of Mathematics and Computer Science, University of Jena, 2009. </li>
<li> <a href="http://scholar.google.com/scholar?as_q=Partial+Kernelization+for+Rank+Aggregation:+Theory+and+Experiments">Partial Kernelization for Rank Aggregation: Theory and Experiments.</a> N. Betzler, R. Bredereck, and R. Niedermeier. Proc. 5th International Symposium on Parameterized and Exact Computation (IPEC), 2010. </li>
</ul></p>

